import React, { Component } from "react";

class Home extends Component {
  state = {};
  render() {
    return (
      <div className="container">
        <Link className="nav-item nav-link" to="/searchRide">
          Need a Ride
        </Link>
        <Link className="nav-item nav-link" to="/offerRide">
          Offer a Ride
        </Link>
      </div>
    );
  }
}

export default Home;
